import React from 'react';
import { StyleSheet, ImageBackground, View, TouchableOpacity, Text} from 'react-native';

const AboutUsScreen = ({ navigation }) => {
  return (
		<ImageBackground source={require('./../../assets/home.jpg')} style={styles.backgroundImage}>
		</ImageBackground>
	);
}

const styles = StyleSheet.create({
	backgroundImage: {
		flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
	},
	fixToText: {
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  fixToEnd: {
    position: 'absolute',
    width: 100,
    height: 50,
    bottom: 0,
  },
  inputText: {
    color:"white",
  },
  defaultMessage: {
    color:"#274650",
    justifyContent: 'center',
    fontSize : 20,
    height: 80,
    lineHeight: 20,
    alignSelf: 'stretch',
    textAlign: 'center',
    marginBottom: 30,
  },
  button:{
    width: "80%",
    backgroundColor: "#1F3B3F",
    borderRadius: 25,
    height:50,
    width: 300,
    alignItems: "center",
    justifyContent: "center",
    marginBottom: 10,
  },
  aboutUs:{
    width: "80%",
    borderRadius: 25,
    height:50,
    width: 300,
    alignItems: "center",
    justifyContent: "center",
    marginBottom: 10,
  },
  aboutText: {
    color:"black",
  },
});

export default AboutUsScreen;
